function computeNewConsensus(taskNum, users) {
	var voteSumConsensus = {};

	var weight = 0;

	for (let user of users) {
		var segs = data[user].vals[taskNum];

		weight += data[user].weight;
				
		for (let segId in segs) {
			if (voteSumConsensus[segId] === undefined) {
				voteSumConsensus[segId] = {
					sumLog1: 0,
					sumLog0: 0
				};
			}
		}
	}

	for (let user of users) {
		var segs = data[user].vals[taskNum];
		var prob = data[user].prob;
				
		for (let segId in voteSumConsensus) {
			if (segs[segId] === undefined) {
				voteSumConsensus[segId].sumLog1 += Math.log2(1 - prob.p1);
				voteSumConsensus[segId].sumLog0 += Math.log2(prob.p0);
			} else {
				voteSumConsensus[segId].sumLog1 += Math.log2(prob.p1);
				voteSumConsensus[segId].sumLog0 += Math.log2(1 - prob.p0);
			}
		}
	}

	let result = {};

	for (let segId in voteSumConsensus) {
		let seg = voteSumConsensus[segId];
		result[segId] = 1.0 / ( Math.pow( 2.0 , seg.sumLog0 - seg.sumLog1) + 1 );
	}


	return [result, weight];
}


function computeOldConsensus(taskNum, users) {
	var consensus = {};
	var totalWeight = 0;

	for (let user of users) {
		var segs = data[user].vals[taskNum];
		var weight = data[user].weight;
		totalWeight += weight;
		
		for (let segId in segs) {
			consensus[segId] = consensus[segId] || 0;
			consensus[segId] += weight;
		}
	}

	for (let segId in consensus) {
		consensus[segId] /= totalWeight;
	};

	delete consensus[0];

	return [consensus, totalWeight];
}




